import React from "react";
import Banner from "./Banner";
import { Separator } from "../styles/theme";
import { Grid, Stack, Typography } from "@mui/material";
import { Container } from "@mui/material";

export default function Home() {
  return (
    <Stack>
      <Banner />
      <Separator />
      <Container>
        <Grid container sx={{ padding: "30px 30px 5px 30px" }} spacing={3}>
          <Grid item md={4} sm={6} xm={12} lg={4}>
            <Link href="/menulist">
              <Card
                elevation={3}
                sx={{
                  boxSizing: "border-box",
                  transition: "0.5s ease 0s, transform 0.5s ease 0s;",
                }}
                className="zoomer"
              >
                <CardMedia
                  component="img"
                  height="140"
                  image={
                    "https://res.cloudinary.com/dkz3uzlnp/image/upload/v1660729369/food-bang/pexels-mali-maeder-65175_hkspze.jpg"
                  }
                  alt="Order Online"
                />
                <CardContent>
                  <Typography gutterBottom variant="h5" component="div">
                    Order Online
                  </Typography>
                  <Typography variant="body1">
                    Stay Home and order at your doorstep with your loved ones.
                  </Typography>
                </CardContent>
              </Card>
            </Link>
          </Grid>
        </Grid>
      </Container>
    </Stack>
  );
}
